$.validator.methods.range=function(n,t,i){var r=n.replace(",",".");return this.optional(t)||r>=i[0]&&r<=i[1]};$.validator.methods.number=function(n,t){return this.optional(t)||/^-?(?:\d+|\d{1,3}(?:\.\d{3})+)(?:,\d+)?$/.test(n)};$.validator.addMethod("unlike",function(n,t,i){var r=$("#"+i.otherproperty);return this.optional(t)||r.val()!=n});$.validator.unobtrusive.adapters.add("unlike",["otherproperty","otherpropertyname"],function(n){var t={otherproperty:n.params.otherproperty,otherpropertyname:n.params.otherpropertyname};n.rules.unlike=t;n.messages.unlike=n.message});